svg.script:
// Global Variables
var scale;
var transX;
var transY;
var svgDoc;
var svgSVGObj;

// initializeVariables
function initCoords(evt) {
	var directTarget = evt.getTarget();
	if( directTarget.getNodeType() != 9 ) // if not DOCUMENT_NODE
		svgDoc = directTarget.getOwnerDocument();
	else
		svgDoc = directTarget;

	svgSVGObj = svgDoc.getDocumentElement();
	resetCoords();
}

//get current zoom and pan values
function resetCoords() {
	scale = svgSVGObj.getCurrentScale();
	var trans = svgSVGObj.getCurrentTranslate();
	transX = trans.getX();
	transY = trans.getY();
}

// Position and show hyperlinks menu
function showHyperlinks(evt, MenuID){
	var menu = svgDoc.getElementById(MenuID);
	menu.setAttribute('style', 'visibility:visible');
	var	menuParent = menu.getParentNode();
	var newScale = 1 / parseFloat(scale);
	var newTranslateX = (evt.clientX - 4 - transX) * newScale;
	var newTranslateY = (evt.clientY - 4 - transY) * newScale;
	newtransform = "translate(" + newTranslateX + " " + newTranslateY + ") " + "scale(" + newScale + ")";
	menuParent.setAttribute('transform', newtransform);
}

// Hide hyperlinks menu
function hideHyperlinks(evt, MenuID){
	var menu = svgDoc.getElementById(MenuID);
	menu.setAttribute('style', 'visibility:hidden');
}

// Update status line for hyperlinks
function promptHyperlinks(evt){
	status="Multiple hyperlinks";
}
